INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (1, 1, 'Dolor quas rerum odio ut.', 'Rerum et at delectus iusto et. Culpa qui illum nihil doloremque. Veniam molestiae quam et dolorem eveniet.', 'Illum ab facilis sequi. Est culpa saepe et consectetur. Similique vel et tempore aliquam. Dolore ipsa hic suscipit sed earum numquam quisquam.', '2000-11-28');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (2, 2, 'Iure tempora occaecati ipsa quos amet magni.', 'Et labore deserunt maxime eligendi. Qui autem est temporibus laboriosam velit. Explicabo officia eum ea. Cupiditate quia nisi aliquam veritatis.', 'Sunt sed deserunt beatae dolor. Optio unde illum asperiores pariatur. Veritatis quae magnam minus quia placeat. Ipsum sed enim commodi culpa.', '1987-02-13');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (3, 3, 'Ut inventore ipsum atque nobis totam.', 'Tempora repellat sint consequuntur veritatis nobis. Error possimus ut commodi et. Saepe rerum placeat rerum explicabo numquam.', 'At labore dolorem velit quia. Possimus officiis hic laborum reprehenderit. Iure est et at vitae eum minus.', '1997-03-07');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (4, 4, 'Totam mollitia sed perspiciatis repellendus aut aut.', 'Quia velit aperiam reiciendis et non vel et nesciunt. Dignissimos provident reprehenderit doloribus molestiae. Sequi nesciunt ut facere vel dolor. Labore accusantium et facere labore distinctio.', 'Rerum minima veritatis tempore quisquam. Esse in nihil alias delectus dicta. Eligendi repellendus suscipit omnis odio aliquid non.', '2002-04-10');
